import React from "react"

class AddButton extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <input type="button" value = ">>" id="add button" className="button" onClick={() => this.props.handleclick()}/>
        );
    }
}
export default AddButton;
